import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './Header'; // Adjust the path based on your project structure
import HomePage from './HomePage'; // Assuming you have a HomePage component
import LoginPage from './LoginPage'; // Assuming you have a LoginPage component

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<LoginPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
